Site: Can He Score?
Girls: Cathy Heaven  

This week we have the very beautiful Cathy Heaven who just came to the States from Hungary. She's new to the industry only been on for 6 or 7 months now and she's loving every minute of it. So this wee we decided to put her on to a nice change of pace and put her on a date with a regular joe and see just how she handles herself in a real life situation. So Enter Sebastian he just came back from Afghanistan a few months ago. He seems a little shell shocked because he's not much of a talker. I guess it works out because Cathy doesnt speak very good English. So can these two work it out and get it on or are they just gonna fall on their asses...CAN HE SCORE?!
